import React from 'react';
import Grid from '@mui/material/Grid';
import { GiCow } from 'react-icons/gi';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';

const divStyle = {
  color: '#082459',
  fontSize: '24px',
  fontFamily: 'Roboto',
  fontWeight: 700,
  wordWrap: 'break-word',
};

function Item(props) {
  const { sx, ...other } = props;
  return (
    <Box
      sx={{
        bgcolor: (theme) => (theme.palette.mode === 'dark' ? '#101010' : '#fff'),
        color: (theme) => (theme.palette.mode === 'dark' ? 'grey.300' : 'grey.800'),
        border: '1px solid',
        borderColor: (theme) =>
          theme.palette.mode === 'dark' ? 'grey.800' : 'grey.300',
        p: 1,
        borderRadius: 2,
        fontSize: '0.875rem',
        fontWeight: '700',
        ...sx,
      }}
      {...other}
    />
  );
}

Item.propTypes = {
  sx: PropTypes.oneOfType([
    PropTypes.arrayOf(
      PropTypes.oneOfType([PropTypes.func, PropTypes.object, PropTypes.bool]),
    ),
    PropTypes.func,
    PropTypes.object,
  ]),
};

export default function Gridbox() {
  return (
    <div style={{ width: '100%' }}>
      <Box
        sx={{
          display: 'grid',
          gap: 1,
          gridTemplateColumns: 'repeat(2, 1fr)',
        }}
      >
        <div style={{ width: '100%', height: '100%', justifyContent: 'center', alignItems: 'center', display: 'inline-flex' }}>
      <div style={{ width: '176px', height: '130px', position: 'relative' }}>
        <div style={{ width: '176px', height: '130px', left: '0px', top: '0px', position: 'absolute', background: 'white', boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.25)', borderRadius: '8px' }}></div>
        <div style={{ width: '36px', height: '40px', left: '16px', top: '45px', position: 'absolute' }}>
          <div style={{ width: '26px', height: '22px', left: '0px', top: '18px', position: 'absolute', background: '#2F88FF', border: '4px black solid' }}></div>
          <div style={{ width: '10px', height: '10px', left: '8px', top: '24px', position: 'absolute', border: '4px white solid' }}></div>
          <div style={{ width: '12px', height: '10px', left: '24px', top: '6px', position: 'absolute', border: '4px black solid' }}></div>
          <div style={{ width: '10px', height: '8px', left: '14px', top: '0px', position: 'absolute', border: '4px black solid' }}></div>
          <div style={{ width: '10px', height: '24px', left: '26px', top: '16px', position: 'absolute', background: '#2F88FF', border: '4px black solid' }}></div>
          <div style={{ width: '26px', height: '10px', left: '0px', top: '8px', position: 'absolute', border: '4px black solid' }}></div>
        </div>
        <div style={{ left: '64px', top: '39px', position: 'absolute', color: 'black', fontSize: '24px', fontFamily: 'Roboto', fontWeight: '700', wordWrap: 'break-word' }}>111k</div>
        <div style={{ left: '64px', top: '68px', position: 'absolute', color: '#888888', fontSize: '16px', fontFamily: 'Roboto', fontWeight: '700', wordWrap: 'break-word' }}>ปริมาณนม</div>
      </div>
    </div>
        <Grid item xs>
          <Item style={{ backgroundColor: 'rgb(255, 255, 255)' , boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.25)'}}>
            <GiCow size={30} />
            <div style={{ fontSize: '30px', fontWeight: 'bold' }}>10</div>
            <div>Total Cows (ตัว)</div>
          </Item>
        </Grid>
        <Grid item xs>
          <Item style={{ backgroundColor: 'rgb(255, 255, 255)' , boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.25)'}}>
            <GiCow size={30} />
            <div style={{ fontSize: '30px', fontWeight: 'bold' }}>10</div>
            <div>Total Cows (ตัว)</div>
          </Item>
        </Grid>
        <Grid item xs>
          <Item style={{ backgroundColor: 'rgb(255, 255, 255)' , boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.25)'}}>
            <GiCow size={30} />
            <div style={{ fontSize: '30px', fontWeight: 'bold' }}>10</div>
            <div>Total Cows (ตัว)</div>
          </Item>
        </Grid>
      </Box>
    </div>
  );
}
